        content: [
            {
                image: 'building',
                width: 280,
                alignment: 'center',
                margin: [0, 30, 0, 10],
            },
            {
                stack: [
                    {
                        text: 'ORÇAMENTO',
                        style: 'text',
                        alignment: 'center',
                        margin: [0, 0, 0, 8],
                    },
                    {
                        text: `Cliente: ${props.clienteInfo.nomeCliente}`,
                        style: 'text',
                        margin: [0, 0, 0, 6],
                    },
                    {
                        text: `Razão social: ${props.clienteInfo.razaoSocial} / Cnpj:${props.clienteInfo.cnpj}`,
                        style: 'text',
                        margin: [0, 0, 0, 6],
                    },
                    {
                        text: `Endereço: ${props.clienteInfo.endereco} - ${props.clienteInfo.cep}`,
                        style: 'text',
                        margin: [0, 0, 0, 6],
                    },
                    {
                        text: [
                            {
                                text: `Data: ${dataPersonalizada} `,
                                style: 'text',
                            },
                            {
                                text: 'Valido por 10 dias',
                                style: 'text',
                                bold: false,
                                decoration: 'underline',
                            }],
                        alignment: 'right',
                        margin: [0, 0, 0, 10],
                    },
                    {
                        text: 'DESCRIÇÃO DO TRABALHO REALIZADO',
                        style: 'text',
                        margin: [0, 0, 0, 14],
                        alignment: 'center'
                    },
                    {
                        alignment: 'center',
                        margin: [0, 0, 0, 18],
                        table: {
                            heights: 10,
                            headerRows: 1,
                            widths: [250, '*', 80],

                            body: [
                                [{ text: 'Material', style: 'text' }, { text: 'Quant', style: 'text' }, { text: 'Valor', style: 'text' }],
                                ...props.materiais.map(material => [
                                    { text: material.nomeMaterial, style: 'text' },
                                    { text: material.quantidade.toString(), style: 'text' },
                                    { text: `R$ ${material.preco.toFixed(2)}`, style: 'text' }
                                ]),
                                [{ text: '' }, { text: '' }, { text: '' }],
                                [{ text: 'Valor do material', style: 'text' }, { text: '', style: 'text' }, { text: `R$ ${valorMaterial.value.toFixed(2)}`, style: 'text' }],
                                [{ text: '' }, { text: '' }, { text: '' }],
                                [{ text: 'Mão de obra', style: 'text' }, { text: '', style: 'text' }, { text: `R$ ${props.maoDeObra.toFixed(2)}`, style: 'text' }],
                                [{ text: '' }, { text: '' }, { text: '' }],
                                [{ text: 'Valor total ', style: 'text' }, { text: '', style: 'text' }, { text: `R$ ${valorTotal.value.toFixed(2)}`, style: 'text' }]
                            ]
                        },
                        layout: {
                            fillColor: function (rowIndex, node, columnIndex) {
                                return (rowIndex === 0) ? '#CCCCCC' : null;
                            }
                        },
                    },
                    {
                        text: 'PLANO DE PAGAMENTO',
                        style: 'text',
                        margin: [0, 0, 0, 14],
                        alignment: 'center'
                    },
                    {
                        text: ' Pagamento a combinar. \n\nObs: Os trabalhos a serem realizados seguirão rigorosamente as normas da ABNT,NBR e do corpo de bombeiros. ',
                        style: 'text',
                        bold: false,
                        margin: [0, 0, 0, 14],
                        alignment: 'center'
                    },
                    {
                        text: [
                            {
                                text: 'OBSERVAÇÕES: ',
                                style: 'text',
                            },
                            {
                                text: ' Se houver necessidade da ART (Anotação Responsabilidade técnica), haverá um acréscimo de 550,00 reais no orçamento.',
                                style: 'text',
                                decoration: 'underline',
                            }],
                        alignment: 'center',
                        margin: [0, 0, 0, 14],
                    },
                    {
                        text: 'CONCLUSÃO',
                        style: 'text',
                        margin: [0, 0, 0, 14],
                        alignment: 'center'
                    },
                    {
                        text: 'Agradecemos pela oportunidade que temos em apresentar essa proposta comercial, e nos colocamos a disposição para esclarecer eventuais dúvidas.',
                        style: 'text',
                        bold: false,
                        margin: [0, 0, 0, 14],
                        alignment: 'center'
                    },
                    {
                        image: 'assinatura',
                        alignment: 'center',
                        width: 100
                    },
                    {
                        text: 'Adão Pereira\n\ntécnico Via Gás',
                        style: 'text',
