                        style: 'text',
                        margin: [0, 0, 0, 14],
                        alignment: 'center'
                    }
                ],
                margin: [50, 0, 50, 30]
            }
        ],
        styles: {
            text: {
                fontSize: 10,
                bold: true,
            }
        },
        images: {
            assinatura: 'data:image/png;base64,',
            building: 'data:image/png;base64,'
        }
    };
    pdfMake.createPdf(docDefinition).open();
}
</script>

